For most of Levi’s life, he has watched me work out at home, and I have been wanting to get him his own workout equipment. The day has finally come, because Bebé Fuerte has created fitness inspired baby and toddler toys including a little dumbbell and kettlebell Levi can now use 😍

I like how the kettlebell is multi use, you can take it apart and put it back together. The dumbbell even makes a fun sound! The toys incorporate English and Spanish, on the kettlebell it says 123 and uno dos tres! Get yours today at select @walmart stores near you!

@tomy_toy @robinnyc #TOMYToys #BebeFuerte #TOMYToysxRobinArzon #SiSePuede #yestomy

I think my favorite is when Levi tries to say “si se puede”!😍 His little voice gets me every time 🥹 He loves his new toys from @tomy_toy

